						$scope.getPrices = function (checkedObject, checkedProperty = null, checkedIndex = null) {
							
							var totalPrice = 0;	
							var minPrice = 0;
							var pricesObject = [];
							
							for(var i in checkedObject){
								for(var j in checkedObject[i]){									
									if ( typeof $scope.addDeviceToTotals[i] != 'undefined'
										&&
										typeof $scope.addDeviceToTotals[i][j] != 'undefined')
									{
										if ( $scope.addDeviceToTotals[i][j] == true ) pricesObject.push(checkedObject[i][j]);
									}
								}
							} 
							
							if (checkedProperty != null && checkedIndex != null) {
								minPrice = (typeof pricesObject[0] != 'undefined' && pricesObject[0][checkedProperty][checkedIndex] && pricesObject[0][checkedProperty][checkedIndex] > 0) ? pricesObject[0][checkedProperty][checkedIndex] : 0;
								
								angular.forEach(pricesObject, function(prices, index) {
									if (prices[checkedProperty][checkedIndex] > 0) {
										totalPrice += parseInt(prices[checkedProperty][checkedIndex]);
									}
									if (prices[checkedProperty][checkedIndex] < minPrice) {
										minPrice = prices[checkedProperty][checkedIndex];
									}
								});
							} else if (checkedProperty != null ) {
								minPrice = (typeof pricesObject[0] != 'undefined' && pricesObject[0][checkedProperty] > 0) ? pricesObject[0][checkedProperty] : 0;
								
								angular.forEach(pricesObject, function(prices, index) {
									if (prices[checkedProperty] > 0) {
										totalPrice += parseInt(prices[checkedProperty]);
									}
									if (prices[checkedProperty] < minPrice) {
										minPrice = prices[checkedProperty];
									}
								});
							} else {
								minPrice = ( typeof pricesObject[0] != 'undefined' ) ? pricesObject[0] : 0;
								
								angular.forEach(pricesObject, function(price, index) {
									if (prices > 0) {
										totalPrice += parseInt( prices );
									}
									if (prices < minPrice) {
										minPrice = prices;
									}
								});
							}
							
							return { 'min' : minPrice, 'total' : totalPrice };
						};
						
